    public function getSourceContext()
    {
        return new Source("{% extends 'views/layouts/contentLayoutMaster.html.twig' %}

{% block title %}
  {{ 'Manage a User' }}
{% endblock %}

{% block vendor_style %}
  <link rel=\"stylesheet\" href=\"{{ asset('vendors/css/forms/select/select2.min.css') }}\">
{% endblock %}
{% block page_style %}
  <link rel=\"stylesheet\" href=\"{{ asset('css/base/plugins/forms/form-validation.css') }}\">
{% endblock %}

{% block content %}
  <h3>Manage User</h3>
  <p>Fill the form below to populate your user data.</p>

  <div class=\"card\">
    <div class=\"card-header\">
      <h4 class=\"card-title\">Permission Details</h4>
    </div>
    <div class=\"card-body\">
      {{ form_start(form, {'method': 'POST'}) }}
      <div class=\"row\">

        <div class=\"col-md-6 col-12\">
          {{ form_row(form.first_name) }}
        </div>
        <div class=\"col-md-6 col-12\">
          {{ form_row(form.last_name) }}
        </div>

        <div class=\"col-md-6 col-12\">
          {{ form_row(form.phonenumber) }}
        </div>
        <div class=\"col-md-6 col-12\">
          {{ form_row(form.email) }}
        </div>

        <div class=\"col-md-6 col-12\">
          {{ form_row(form.identityType) }}
        </div>
        <div class=\"col-md-6 col-12\">
          {{ form_row(form.identityDocumentNumber) }}
        </div>

        <div class=\"col-md-6 col-12\">
          {{ form_row(form.userStatus) }}
        </div>
        <div class=\"col-md-6 col-12\">
          {{ form_row(form.class) }}
        </div>

        <div class=\"col-md-6 col-12\">
          {{ form_row(form.groups) }}
        </div>
        <div class=\"col-md-6 col-12\">
          {{ form_row(form.individualPermissions) }}
